import React from 'react'
import { useLocation } from "react-router-dom"

const Booking = (props) => {

  const { state } = useLocation();
  const { namaAlat } = state;


  return (
    <div>Booking, Kamu Pesan {namaAlat}</div>
  )
}

export default Booking
